Как вы думаете, что общего может быть между богатым торговцем недвижимостью, его женой-наркоманкой и грязным пьяницей из трущоб?

Лишь одно жуткое обстоятельство: все они жертвы неслыханных по жестокости преступлений, потрясших Нью-Йорк!

Ведущий расследование ветеран &laquo;убойного отдела&raquo; скоро с ужасом начинает понимать, что зловещие убийства совершаются древними сверхъестественными существами&#133;

Чтобы вернуть бриллианты на 20 миллионов долларов, они не остановятся ни перед чем&#133; После смерти мужа Сьюзан ведет затворническую жизнь на маленьком островке у побережья штата Мэн. Внезапно в ее доме появляется Джефф, серьезно раненый после несчастного случая на море.

Сьюзан приглашает его пожить у себя до полного выздоровления. Все больше доверяя Джеффу, она находит повод, чтобы он погостил у нее подольше. Сьюзан и не подозревает, что её муж вел двойную жизнь и присвоил бриллианты на сумму 20 миллионов долларов, похищенные вместе с двумя подельниками, которые теперь получат свою долю, и Джефф &#151; один из них.

Уверенные в том, что Сьюзан знает, где спрятаны бриллианты, преступники не остановятся ни перед чем&#133;

У директора школы мистера Стимпсона есть один &laquo;пунктик&raquo;. Всю свою жизнь и жизнь своих сотрудников и учеников он сверяет строго по часам. Но когда близится час его славы, отлаженный механизм дает сбой.

Отправившись на престижную учительскую конференцию на другой конец страны, Стимпсон умудряется перепутать поезда. И теперь, чтобы успеть вовремя и произнести самую важную речь в своей жизни, он вынужден принять участие в безумном марафоне по пересеченной местности через всю Англию.

К концу дня Стимпсон, преследуемый полицией, женой, соседями и коллегами по работе, будет объявлен в розыск за угон автомобиля, кражу, похищение и вандализм&#133;
